    constructor(props){
      super(props)
    }

  componentDidMount = () =>{

      $('ul.cards').on('click', function(){
        $(this).toggleClass('transition');
      });

      $('ul.card-stacks').on('click', function(){
        $(this).toggleClass('transition');
      });
  }

  render() {
    return (
      <div>
<ul className="card-stacks">card-stacks</ul>
  <li className="title">title</li>
    <h2> Expand to grid </h2>
  <li className="stack.stack-1">
    <ul className="cards-down">
      <li>
        <img src="http://lorempixel.com/401/250/city" />
        <div className="content"> 
          <h1> Card 1 Title</h1>
          <p> Stack 1</p>
          </div>
          </li>
          </ul>
          </li>
     </div>
    );
  }
}
